import React, { useState } from 'react';
import './App.css';
import Login from './components/Login';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  // Function to handle login success
  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  return (
    <div className="App">
      {isLoggedIn ? (
        <h1>Welcome to the Tourism App!</h1>  // This will be replaced with the dashboard later
      ) : (
        <Login onLogin={handleLogin} />
      )}
    </div>
  );
}

export default App;
